import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import Textars from '../Nivel0/textarea'



const ContServicios = () => {
  const [nombre, setNombre] = useState('');
  const [email, setEmail] = useState('');
  const [identificacion, setIdentificacion] = useState('');
  const [apelidos, setApelidos] = useState('');
  const [Telefono, setTelefono] = useState('');
  const [direccion, setDireccion] = useState('');
  const [codeprob, setCodeprob] = useState('');
  const [requisito1, setrequisito1] = useState('');
  const [requisito2, setrequisito2] = useState('');
  const [descripcion, setDescripcion] = useState('');


  const handleSubmit = (e) => {
    e.preventDefault();
    // Aquí puedes realizar la lógica para enviar los datos del formulario
  };

  return (
    <form>
      <div style={{ marginRight: '20px', marginLeft: '20px' }}>
        <label>ID:</label>
        <input
          type="text"
          value={identificacion}
          onChange={(e) => setIdentificacion(e.target.value)}
          placeholder="HT6767788TY"
        />
      </div>

      <div style={{ marginRight: '20px', marginLeft: '20px' }} >
        <label>Nombre:</label>
        <input
          type="text"
          value={nombre}
          onChange={(e) => setNombre(e.target.value)}
          placeholder="Jose Domingo Bee"
        />
      </div>

      <div style={{ marginRight: '20px', marginLeft: '20px' }}>
        <label>Apelidos:</label>
        <input
          type="text"
          value={apelidos}
          onChange={(e) => setApelidos(e.target.value)}
          placeholder="Owono Nchama"
        />
      </div>

      <div style={{ marginRight: '20px', marginLeft: '20px' }}>
        <label>Correo Electronico:</label>
        <input
          type="email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          placeholder="elsolito25@gmail.com"
        />
      </div>

      <div style={{ marginRight: '20px', marginLeft: '20px' }}>
        <label>Telefono:</label>
        <input
          type="tel"
          value={Telefono}
          onChange={(e) => setTelefono(e.target.value)}
          placeholder="+34 613 62 05 76 "
        />
      </div>

      <div style={{ marginRight: '20px', marginLeft: '20px' }}>
        <label>Direccion:</label>
        <input
          type="text"
          value={direccion}
          onChange={(e) => setDireccion(e.target.value)}
          placeholder="G.E/Malabo/Perez"
        />
      </div>

      <div style={{ marginRight: '20px', marginLeft: '20px' }}>
        <label>Fecha:</label>
        <input
          type="date"
          value={codeprob}
          onChange={(e) => setCodeprob(e.target.value)}
        />
      </div>

      <div style={{ marginRight: '20px', marginLeft: '20px' }}>
        <label>Especificacion de requisitos 1:</label>
        <input
          type="file"
          value={requisito1}
          onChange={(e) => setrequisito1(e.target.value)}
        />
      </div>

      <div style={{ marginRight: '20px', marginLeft: '20px' }}>
        <label>Especificacion de requisitos 2:</label>
        <input
          type="file"
          value={requisito2}
          onChange={(e) => setrequisito2(e.target.value)}
        />
      </div>

      <div style={{ marginRight: '20px', marginLeft: '20px' }}>
        <label>Descripcion del problema:</label>
        <input
          type="text"
          value={descripcion}
          onChange={(e) => setDescripcion(e.target.value)}
          placeholder="Deje su problema"
        />
      </div>

      <Textars/>


      <div style={{ marginLeft: '-400px', marginTop: '400px' }}>
      <button type="button" style={{ marginLeft: '15px', marginBottom: '10px' }} onClick={handleSubmit}>
        Contratar Servicio
      </button>
      </div>

    </form>
  );
};

export default ContServicios;
